import React from 'react';
import { FaCode, FaReact, FaGithub, FaLinkedin, FaPhp, FaHtml5, FaCss3, FaPython, FaJava, FaJs, FaBootstrap, FaNodeJs, FaDatabase } from 'react-icons/fa';
import '/src/Hero.css';

const Hero = () => {
  // Icons data
  const icons = [
    { id: 1, icon: <FaPhp className="moving-icon" /> },
    { id: 2, icon: <FaNodeJs className="moving-icon" /> },
    { id: 3, icon: <FaBootstrap className="moving-icon" /> },
    { id: 4, icon: <FaPython className="moving-icon" /> },
    { id: 5, icon: <FaReact className="moving-icon" /> },
    { id: 6, icon: <FaJava className="moving-icon" /> },
    { id: 7, icon: <FaDatabase className="moving-icon" /> },
  ];

  // Base64 encoded image string
  const base64Image = "data:image/jpeg;base64,";
  return (
    <section id="home" className="hero">
      <div className="container">
        <div className="hero-content">
          <div className="text-content">
            <h1>Building Digital Experiences That Inspire</h1>
            <p className="subhead">Hello, I'm Mandeep, a dedicated Full-Stack Web Developer blending creativity with technical precision to build impactful web solutions. My journey in development is fueled by a passion for turning ideas into interactive digital realities, combining aesthetic design with robust functionality.</p>
            <button className="btn-hire">Hire Me</button>
          </div>

          {/* Image */}
          <div className="image-container">
            <img
              src={base64Image} // Using the base64 encoded image
              alt="Your Portrait"
              className="portrait"
            />
          </div>
        </div>

        {/* Separate Space for Icons */}
        <div className="moving-icon-space">
          <div className="icon-container">
            {icons.map((icon) => (
              <div key={icon.id} className="icon-box">
                {icon.icon}
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default Hero;
